import React, { Component } from 'react';
import Ninja from './Ninja';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>My first React app</h1>
        <p>Welcome :)</p>
        <Ninja name="Hany" age="25" belt="Brown"/> 
        <Ninja name="Razan" age="28" belt="Brown"/> 
      </div>
    );
  }
}

export default App;
